import { IJoin } from "../Repository/JoinRepository";

export default class JoinVO implements IJoin{
    private id:string;
    private password:string;
    private nickName : string;


    /**
     * Getter $id
     * @return {string}
     */
	public get $id(): string {
		return this.id;
	}

    /**
     * Setter $id
     * @param {string} value
     */
	public set $id(value: string) {
		this.id = value;
	}

}
